import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import * as serviceWorkerRegistration from './serviceWorkerRegistration';
ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById('root')
);

// Si vous voulez que votre app fonctionne hors ligne et se charge plus rapidement, vous pouvez changer
// unregister() pour register() ci-dessous. Notez que cela comporte quelques pièges.
// En savoir plus sur les service workers : https://cra.link/PWA
serviceWorkerRegistration.register();
